import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import Home from './home/Home';
import Products from './components/Products';
import { createBrowserRouter, RouterProvider } from 'react-router-dom';
import PumpDetail from './components/PumpDetail';
import AboutUs from './components/About';
import ContactUs from './components/contact';
import AdminPortal from './components/AdminPortal'; // Import AdminPortal component
import 'font-awesome/css/font-awesome.min.css';

const router = createBrowserRouter([
  {
    path: "/",
    element: <App />,
    children: [
      { index: true, element: <Home /> },
      { path: "products", element: <Products /> },
      { path: "pumpDetail/:pumpId", element: <PumpDetail /> }, 
      { path: "about", element: <AboutUs /> },
      { path: "contact", element: <ContactUs /> },
      { path: "admin", element: <AdminPortal /> },  {/* Added Admin Portal route */}
    ]
  }
]);

ReactDOM.createRoot(document.getElementById('root')).render(
  <React.StrictMode>
    <RouterProvider router={router} />
  </React.StrictMode>
);
